import React from 'react'
import {AppBar, Menu as Menue, IconButton, Toolbar, Typography, MenuItem } from '@material-ui/core'
import { makeStyles } from '@material-ui/styles'
import { Menu } from '@material-ui/icons'


const styles = makeStyles({
    icon:{
        color: 'white'
    },
    settings:{
        display: 'flex',
        justifyContent: 'flex-end'
    }
})
interface IProps{
    title: string
}

const HeaderBar: React.FC<IProps> = (props) =>{

    const {title} = props
    const useStyle = styles()

    const [open, setOpen] = React.useState<boolean>(false)

    return(
        
        <AppBar color='primary' position='sticky'>
            <Toolbar style={{display: 'flex', justifyContent: 'space-between'}}>
                <Typography variant="h6" component="div" >
                    Home
                </Typography>
               
                <IconButton
                    aria-label="account of current user"
                    aria-controls="menu-appbar"
                    aria-haspopup="true"
                    onClick={() => {setOpen(true)}}
                    color="inherit"
                >
                    <Menu />
                </IconButton>
              
            </Toolbar>
            <Menue
                id="menu-appbar"
                style={{top: -420}}
                anchorOrigin={{
                  vertical: 'top',
                  horizontal: 'right',
                }}
                keepMounted
                transformOrigin={{
                  vertical: 'top',
                  horizontal: 'right',
                }}
                open={open}
                onClose={() =>{setOpen(false)}}
              >
                <MenuItem onClick={() =>{setOpen(false)}}>Profile</MenuItem>
                <MenuItem onClick={() =>{setOpen(false)}}>My account</MenuItem>
              </Menue>
        </AppBar>

    )
}

export default HeaderBar
